t-align:center;\">\r\n				<span class=\"STYLE3\">方向盘下<br />\r\n</span>			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center;\">\r\n				<span>遥控钥匙类型<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE1\">直板分体 遥控器专用315频率 ASK调频&nbsp;<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE2\">直板分体 遥控器专用315频率 ASK调频&nbsp;<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE3\">折叠遥控202AD型号 433频率 ASK调频&nbsp;<br />\r\n</span>			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center;\">\r\n				<span>遥控是否可生成<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE1\">是&nbsp;<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE2\">是<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE3\">是<br />\r\n</span>			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center;\">\r\n				<span>遥控器匹配方法<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE1\">手工匹配：车门关好上锁钥匙开关3下按遥控即可&nbsp;<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE2\">手工匹配：车门关好上锁钥匙开关3下按遥控即可<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE3\">设备进09系统匹配<br />\r\n</span>			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center;\">\r\n				<span>市场参考价格<br />\r\n</span>			</td>\r\n			<td>\r\n				<div class=\"STYLE1\" style=\"text-align:center;\">\r\n					<span style=\"line-height:1.5;\">增加单把钥匙200&nbsp;</span>				</div>			  <div class=\"STYLE1\" style=\"text-align:center;\">\r\n		  <span>全丢配单把钥匙500	      </span></div>			</td>\r\n			<td>\r\n				<div class=\"STYLE2\" style=\"text-align:center;\">\r\n					<span style=\"line-height:1.5;\">增加单把钥匙300&nbsp;</span>				</div>			  <div class=\"STYLE2\" style=\"text-align:center;\">\r\n		  <span>全丢配单把钥匙600&nbsp;				</span></div>			</td>\r\n			<td>\r\n				<div class=\"STYLE3\" style=\"text-align:center;\">\r\n					<span style=\"line-height:1.5;\">增加单把钥匙500&nbsp;</span>				</div>			  <div class=\"STYLE3\" style=\"text-align:center;\">\r\n		  <span>全丢配单把钥匙2000&nbsp;				</span></div>			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center;\">\r\n				<span>注意事项&nbsp;<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE1\">按照各类设备提示进行操作全丢和增加方法一样操作如遇到输入正确密码提示错误打开点火等30分钟在配即可<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE2\">按照各类设备提示进行操作全丢和增加方法一样操作如遇到输入正确密码提示错误打开点火等30分钟即可 部分车型可以用阿福迪读取发动机电脑数据取消防盗，完事之后防盗盒拔掉即可<br />\r\n</span>			</td>\r\n			<td style=\"text-align:center;\">\r\n				<span class=\"STYLE3\">大众四代防盗系统操作前先保存好数据严格按照各类设备提示操作 增加与全丢方法不一样全丢比较复杂需要在线如遇匹配遥控进不去系统车内中控锁按一下即可.很多低配车型不带遥控建议安装腾达大众套装即可实现遥控功能&nbsp;<br />\r\n</span>			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center;\">\r\n				数据下载			</td>\r\n			<td>\r\n				<span class=\"STYLE1\"><br />\r\n</span>			</td>\r\n			<td>\r\n				<span class=\"STYLE2\"><br />\r\n</span>			</td>\r\n			<td>\r\n				<span><br />\r\n</span>			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image001.jpg\" alt=\"\" title=\"\" align=\"\" />\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image002.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image003.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image005.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image006.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image007.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image008.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image009.jpg\" alt=\"\" title=\"\" align=\"\" />\r\n</p>\r\n<p>\r\n<ul>\r\n		<li>\r\n			<span style=\"line-height:1.5;font-size:24px;color:#E53333;\"><strong>点火锁头拆出方法</strong></span>\r\n		</li>\r\n</ul>\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image011.jpg\" title=\"\" align=\"\" alt=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image013.jpg\" title=\"\" align=\"\" alt=\"\" />\r\n</p>\r\n<p>\r\n<ul>\r\n		<li>\r\n			<strong><span style=\"font-size:24px;color:#E53333;\">老款桑塔纳钥匙匹配步骤</span></strong>\r\n		</li>\r\n</ul>\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image015.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image017.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image019.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image021.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image023.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image025.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image027.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image029.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image031.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image033.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image035.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image037.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image039.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image041.jpg\" alt=\"\" title=\"\" align=\"\" />&nbsp;\r\n</p>\r\n<p>\r\n	<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image043.jpg\" alt=\"\" title=\"\" align=\"\" />\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:24px;color:#E53333;\">新桑塔纳匹配步骤</span></strong>\r\n</p>\r\n<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image044.jpg\" alt=\"\" title=\"\" align=\"\" />\r\n<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image045.jpg\" alt=\"1.jpg\" />\r\n<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image047.jpg\" alt=\"2.jpg\" />\r\n<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image049.jpg\" alt=\"3.jpg\" />\r\n<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image051.jpg\" /> \r\n<p>\r\n	35XX仪表全丢匹配说明\r\n</p>\r\n<p>\r\n	准备一个POLO的24c64的仪表\r\n</p>\r\n<p>\r\n	1.接原车仪表和发动机电脑，用VVDI进25防盗获取钥匙ID\r\n</p>\r\n<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image053.jpg\" /> <img width=\"546\" height=\"366\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image055.jpg\" /> \r\n<p>\r\n	记录ID为：F3D825F1&nbsp;F3E2C1D2共计2把\r\n</p>\r\n<p>\r\n	1.&nbsp;用副厂48把其中一个ID写入芯片\r\n</p>\r\n<p>\r\n	2.&nbsp;把POLO 24C64的仪表和原车发动机电脑接到一起 用ODIS做一下仪表更换，\r\n</p>\r\n<p>\r\n	3.&nbsp;更换仪表成功后，就用POLO 24C64的仪表 按全丢方法做，生成经销商钥匙时一定要用已经写好的ID48芯片，经销商钥匙生成成功后。换原车仪表和发动机电脑操作。\r\n</p>\r\n<p>\r\n	4.&nbsp;把原车仪表和发动机电脑接好，这是用已经生成好的芯片防盗线圈 可以读取EEP数据保存，再读防盗数据保存，记录CS码和PIN，记录后进VVDI的匹配控制单元 匹配仪表，输入CS码和PIN 点击写入即可 到此结束\r\n</p>\r\n<img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image057.jpg\" /> <img width=\"100%\" src=\"http://www.tengdakey.com/scs/dazhong/sangtana.files/image059.jpg\" />')
